-- Create table
create table SQ_RKCQSY
(
  id         VARCHAR2(32) not null,
  sjidvalue  VARCHAR2(32) not null,
  sjidname   VARCHAR2(32) not null,
  czlx       VARCHAR2(3) not null,
  rksj       VARCHAR2(14) default to_char(sysdate,'yyyymmddhh24miss') not null,
  zhtbsj     VARCHAR2(14),
  tbbs      VARCHAR2(1) default '0' not null,
  rtablename VARCHAR2(30) not null,
  rsjidname  VARCHAR2(32) not null
);
-- Add comments to the columns 
comment on column SQ_RKCQSY.id
  is 'id主键';
comment on column SQ_RKCQSY.sjidvalue
  is '同步数据主键值';
comment on column SQ_RKCQSY.sjidname
  is '同步数据主键名';
comment on column SQ_RKCQSY.czlx
  is '数据操作类型';
comment on column SQ_RKCQSY.rksj
  is '同步数据入库时间';
comment on column SQ_RKCQSY.zhtbsj
  is '最后同步时间';
comment on column SQ_RKCQSY.tbbs
  is '同步标识';
comment on column SQ_RKCQSY.rtablename
  is '同步数据表名称';
comment on column SQ_RKCQSY.rsjidname
  is '远程数据主键名';
-- Create/Recreate primary, unique and foreign key constraints 
alter table SQ_RKCQSY
  add constraint SQ_RKCQSY_PK primary key (ID);
